	// class Node

// Takes the parent of this node
var Node = function(newParent) {
	this.parent = newParent
	this.children = {}
	this.entries = []
}

// Insert an entry into the trie and return the entry. Returns null if failed to insert
Node.prototype.insert = function(name, entry) {
	if (name == "") return this.addEntry(entry)

	var tokens = this.splitPrefix(name)

	if (tokens != null) {
		if (this.children[tokens.first] == null) this.children[tokens.first] = new Node(this)

		return this.children[tokens.first].insert(tokens.rest, entry)
	}

	return null
}

// Add an entry into this node and return the entry. If the entry exists, do nothing and return null
Node.prototype.addEntry = function(entry) {
	var entryHere = this.getEntry(entry.codepoint)

	if (entryHere == null) {
		this.entries.push(entry)
		entry.addNameNode(this)
		return entry
	}

	return null
}

// Search for the entry by codepoint
// Returns the entry or null if not found
Node.prototype.getEntry = function(codepoint) {
	for (i = 0; i < this.entries.length; ++i)
		if (this.entries[i].codepoint === codepoint)
			return this.entries[i]

	return null
}

// Get the number of the entries in this node
Node.prototype.countEntry = function() {
	return this.entries.length
}

// Search for the entry by key
// Returns the entry or null if not found
Node.prototype.find = function(key) {
	if (key == "") return this.entries[0]

	var tokens = this.splitPrefix(key)

	if (tokens === null || this.children[tokens.first] === null) return null

	return this.children[tokens.first].find(tokens.rest)
}

// Build the name as string by traversing the tree upwards to the parent
Node.prototype.getName = function() {
	if (this.parent == null) return ""

	return this.parent.getName() + " " + this.parent.getChildName(this)
}

// Search for the key by node
// Returns the name of the node or null if not found
Node.prototype.getChildName = function(node) {
	for (var k in this.children)
		if (this.children[k] === node)
			return k

	return null
}

// Split the prefix from the key and return a map containing the prefix and the rest of the key
Node.prototype.splitPrefix = function(key) {
	var tokens = key.split(" ")

	if (tokens.length > 0)
		return {first: tokens.shift(), rest: tokens.join(" ")}

	return null
}





	// class LookupTable

// The first entry will be the offset
var LookupTable = function(firstEntry) {
	this.offset = firstEntry.codepoint
	this.entries = [firstEntry]
}

// Search for the entry by codepoint
LookupTable.prototype.find = function(codepoint) {
	if (codepoint >= this.offset + this.entries.length) return null

	var index = codepoint - this.offset

	if (index >= 0 && index < this.entries.length) return this.entries[index]

	return null
}

// Insert an entry into the table and return the entry inserted. If the codepoint is not the next index of the array, do not insert and return null.
LookupTable.prototype.insert = function(entry) {
	if (entry.codepoint !== this.getNextAvailableIndex())
		return null

	this.entries.push(entry)
	return entry
}

// Get the next available index to place an entry into the lookup table array
LookupTable.prototype.getNextAvailableIndex = function() {
	return this.offset + this.entries.length
}





	// class Entry

// Takes the codepoint as number, major category as string and category as string
var Entry = function(newCodepoint, newMajorCategory, newCategory) {
	this.codepoint = newCodepoint
	this.majorCategory = newMajorCategory
	this.category = newCategory
	this.nameNodes = [] // aliases are nodes not in index 0
}

// Build the name by traversing the name nodes
// Returns the cannonical name of the entry
Entry.prototype.getName = function() {
	if (this.nameNodes.length <= 0) return ""

	if (this.nameNodes[0].countEntry() > 1)
		if (this.nameNodes.length > 1)
			return this.nameNodes[1].getName().trim() // return the first alias if ambiguous name

	return this.nameNodes[0].getName().trim()
}

// Add a name node for this entry
Entry.prototype.addNameNode = function(parent) {
	this.nameNodes.push(parent)
}





	// class UnicodeDataStructure

// The data-structure of the unicode table with bidirectional search
var UnicodeDataStructure = function() {
	this.nameRoot = new Node(null)
	this.codepointTables = []
	this.init()
}

// map a codepoint to the corresponding name.
// Returns the name of the codepoint or null if not found
UnicodeDataStructure.prototype.name = function(charCodepoint) {
	var found = this.findEntry(charCodepoint)

	if (found !== null) return found.getName()

	return null
}

// map a string representing a name, or an alias, to a copdepoint
// Returns the codepoint of the name as number or null if not found
UnicodeDataStructure.prototype.character = function(nameString) {
	var entry = this.nameRoot.find(nameString)

	if (entry !== null) return entry.codepoint

	return null
}

// Map a codepoint to a single-character string representing its major category
// Returns the major category as string or null if not found
UnicodeDataStructure.prototype.majorCategory = function(charCodepoint) {
	var found = this.findEntry(charCodepoint)

	if (found !== null) return found.majorCategory

	return null
}

// map a codepoint to a string of length 2 that represents its category.
// Returns the category as string or null if not found
UnicodeDataStructure.prototype.category = function(charCodepoint) {
	var found = this.findEntry(charCodepoint)

	if (found !== null) return found.category

	return null
}

// Insert an entry into the data-structure. Entry must be inserted with codepoint sorted in ascending order/
// Insert of alias will ignore major category and category
UnicodeDataStructure.prototype.insert = function(name, character, majorCategory, category) {
	var entry = this.findEntry(character)

	if (entry === null) {
		entry = this.nameRoot.insert(name, new Entry(character, majorCategory, category))
		var lastTable = this.getLastLookupTable()

		if (lastTable === null) this.addLookupTable(entry)
		else if (lastTable.insert(entry) === null) this.addLookupTable(entry)
	}
	else this.nameRoot.insert(name, entry) // insert alias, discard major category and category
}

// Add a new lookup table. The entry provided will be the codepoint offset
// Returns the newly added lookup table
UnicodeDataStructure.prototype.addLookupTable = function(entry) {
	var table = new LookupTable(entry)
	this.codepointTables.push(table)
	return table
}

// Get the last lookup table
// Returns the last lookup table or null if not found
UnicodeDataStructure.prototype.getLastLookupTable = function() {
	if (this.codepointTables.length < 1) return null

	return this.codepointTables[this.codepointTables.length - 1]
}

// Search for an entry by codepoint
// Returns the found entry or null if not found
UnicodeDataStructure.prototype.findEntry = function(character) {
	for (i = 0; i < this.codepointTables.length; ++i) {
		var found = this.codepointTables[i].find(character)

		if (found !== null) return found
	}

	return null
}

